import React from "react";

function Row(props) {




  return (
    <tr>
      <td> {props.id} </td>
      <td> {props.name}</td>
      <td> </td>

      {( props.private) ? <td> "private" </td>: <td> "pu" </td> }

    </tr>
  );
}

export default Row;
